function spellcheck1() {
    var now = new Date();
    var txt = document.getElementById("txtUserText").value;
    var words = txt.split(" ");
    var output = "";

    for (var i=0; i<words.length; i++) {
        if (!checkWord(words[i]))
            output += "<br>"+words[i]+" is not in the dictionary.";
    }

    var now2 = new Date();
    output += "<br>That took "+(now2-now)+" ms";
    document.getElementById("divOutput").innerHTML = output;
}

function checkWord(word) {
    word = word.toLowerCase();

    // binary search!
    var lower=0, upper=dictionary.length-1;
    var mid;
    var suceeded = false;
    var failed = false;
    var tests = 0;

    while (!suceeded && !failed) {
        var oldmid = mid;
        mid = Math.floor((lower+upper)/2);
        if (oldmid==mid)
            failed = true;
        else if (word==dictionary[mid]) {
            suceeded = true;
            tests++;
        }
        else {
            tests++;
            if (word<dictionary[mid])
                upper = mid; // search lower half
            else
                lower = mid; // search upper half
        }
    }

    console.log(word+" needed "+tests+" tests");
    return suceeded;
}
